import './App.css';
import React, {useState} from "react";
import axios from "axios"

function App() {
    const [todos, setTodos] = useState({todos: []});

    const getTodo = async () => {
        try {
            const res = await axios.get(
                `http://localhost:8080/todo`
            );
            setTodos(res.data)
        } catch (error) {
            console.log('error!!');
        }
    };

    return (
        <div className="App">
            <div>
                <button onClick={() => getTodo()}>get profile!</button>
            </div>
            <div>
                <ul>
                    {todos.todos}
                </ul>
            </div>
        </div>
    );
}

export default App;
